import React from 'react';

class Constants extends React.Component{
	constructor(props){
		super(props)
	}


	render(){
		return (
			<div>
				throwback to the <b className="pageName">variables page</b> when you learned how to initialize a variable and change its value. now, we are going to learn about a special type of variable called a <b>constant</b>. in java, a constant is <b>a variable whose value cannot be changed once it has been initialized</b>. (<b className="note">btw:</b> a constant is an <b>immutable</b> variable, or unable to be changed. on the other hand, the variables you have been creating so far have all been <b>mutable</b>, or able to be changed.)
				<h3>final String str = "it's always recap time";</h3>
				<b>nice job!</b> you made it to recap!
				<br/><br/>
				...we know <b className="note">just for java</b> is as <b>addicting</b> as the newest Netflix binge, so what are you waiting for? <b className="pageName">keep coding!</b>
			</div>
		)
	}
}

export default Constants;
